import React from 'react';
import './App.css';
import Login from './Login';

function App() {
  const [showLogin, setShowLogin] = React.useState(false);

  return (
    <div className="App">
      <RegistrationForm showLogin={showLogin} setShowLogin={setShowLogin} />
      {showLogin && <Login setShowLogin={setShowLogin} />}
    </div>
  );
}

function RegistrationForm({ showLogin, setShowLogin }) {
  return (
    <div>
      <h2>Sign Up for our Local Farmer's Market!</h2>
      <form>
        <label>
          <input type="text" placeholder="Enter a full name" />
        </label>
        <label>
          <input type="email" placeholder="Enter an email" />
        </label>
        <label>
          <input type="tel" placeholder="Enter a phone number" />
        </label>
        <label>
          <input type="password" placeholder="Create a password" />
        </label>
        <label>
          <input type="password" placeholder="Confirm your password" />
        </label>
        <button
          type="button"
          onClick={() => setShowLogin(true)}
        >
          Login
        </button>
        <button type="submit">
          Sign Up
        </button>
      </form>
    </div>
  );
}

export default App;
